const Department = (props) => {
    return (
        <>
            <h1>Department Details</h1>
            <p>Department Name: {props.department}</p>
            <p>Doctor: {props.doctor}</p>
            <p>Nurse: {props.nurse}</p>
        </>
    );
}
export default Department;
